import{_ as t,c as a,o as n,ah as o}from"./chunks/framework.PvdZnrZd.js";const m=JSON.parse('{"title":"Seller Navigation","description":"Seller Navigation","frontmatter":{"title":"Seller Navigation","description":"Seller Navigation","date":"2025-09-26T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/seller/seller-navigation.md","filePath":"zenith/seller/seller-navigation.md"}'),l={name:"zenith/seller/seller-navigation.md"};function i(s,e,r,u,p,d){return n(),a("div",null,[...e[0]||(e[0]=[o('<p><strong>Multivendor Marketplace for Shopify : Manage Seller Menus</strong></p><p>If You own an online Marketplace having multiple sellers registered on it, &quot;Managing Seller Menus&quot; &amp; &quot;Keeping track of Items sold&quot; are the important aspects of Selling.</p><p>With this thought, Webkul has come up with a new option for admin to manage the menus &amp; sub-menus for Seller dashboard in the <a href="/zenith/introduction/">Multivendor Marketplace</a> app.</p><p>Within the Multivendor App, You need to visit the Configuration menu of the admin panel. There, You will get the &quot;Seller Navigation&quot; sub-menu from the drop down.</p><p>Visiting this section of the app, You can add new menus, translate the labels of existing seller menus, enable/disable the status of menus as well as edit the menu details of Seller Dashboard.</p><p>Go to <strong>Seller Navigation</strong> section of the app and <strong>Manage the Menus</strong> of your sellers.</p><h2 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;">​</a></h2><ul><li>Admin can add new menus &amp; sub-menus for Seller Dashboard in the Multivendor app.</li><li>Seller Menus can be enabled or disabled by the admin.</li><li>Admin can rename the labels of existing menus &amp; sub-menus.</li><li>Admin can change the Status of the Menus i.e. whether you want to show the menu on seller dashboard or not.</li><li>Also, admin can enable/disable the Visibility of sub-menus.</li><li>Admin can add sub-menus of existing menus also.</li></ul><h2 id="how-to-manage-menus-for-seller-dashboard" tabindex="-1">How to Manage Menus for Seller Dashboard <a class="header-anchor" href="#how-to-manage-menus-for-seller-dashboard" aria-label="Permalink to &quot;How to Manage Menus for Seller Dashboard&quot;">​</a></h2><h3 id="adding-new-menus" tabindex="-1"><strong>Adding New Menus:</strong> <a class="header-anchor" href="#adding-new-menus" aria-label="Permalink to &quot;**Adding New Menus:**&quot;">​</a></h3><hr><p>To add a new menu for Seller dashboard, You need to visit the configuration menu of the Multivendor App. There, You need to click on the &quot;Seller Navigation&quot; from drop down menu.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/10/snav1.webp" alt="Configuration"></p><p>Clicking on Seller Navigation button, You will be landed to the page from where you will get the option to configure the menus for seller dashboard.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/10/snav2.webp" alt="Configure Menu"></p><p>Once You click on the Configure Menu button, You will have the list of all existing Main Menus of Seller dashboard.</p><p>At the same time, &quot;Add Menu&quot; button appears at the upper right corner of the page.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/10/snav3.webp" alt="Add Menu"></p><p>Clicking on this button, You can add menu options. All You need to do is Enter the Menu Name, enter the page URL where sellers will be redirected and click on &quot;Add Menu Option&quot;.</p><p>Note:- Menu Page URL will be like this: <strong><a href="http://example.com" target="_blank" rel="noreferrer">http://example.com</a></strong></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/10/snav4.webp" alt="Add Seller Navigation"></p><p><strong>Please Note:-</strong> Menu Page URL will not work with Menu having Sub-menus.</p><p>Similarly, You can create sub-menus for the Main Menus.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/10/snav5.webp" alt="Submenu details"></p><p>In this way, new menus &amp; submenus will be created for Seller dashboard from admin end.</p><h2 id="editing-menu-details" tabindex="-1"><strong>Editing Menu Details</strong> <a class="header-anchor" href="#editing-menu-details" aria-label="Permalink to &quot;**Editing Menu Details**&quot;">​</a></h2><p>In the Action menu, You can click on the Edit button to edit the menu details such as rename the labels and update the status of menus &amp; submenus.</p><p>You can set any of the Menus as Landing Page.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/10/snav6.webp" alt="menu details"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/10/snav7.webp" alt="menu"></p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/10/snav8.webp" alt="seller Navigation"></p><p>Similarly, You can rename the labels for the submenus:Admin can rename the main menu directly from the Seller Navigation Page also.</p><p>This is how, admin can edit the existing menus &amp; submenus of Seller Panel.</p><p>This is the way, admin can manage the Menus &amp; Submenus for Seller dashboard in the Multivendor App.</p><h3 id="demo" tabindex="-1">Demo <a class="header-anchor" href="#demo" aria-label="Permalink to &quot;Demo&quot;">​</a></h3><p><a href="https://multivendor-marketplace-4.myshopify.com/" target="_blank" rel="noreferrer">https://multivendor-marketplace-4.myshopify.com/</a></p>',36)])])}const g=t(l,[["render",i]]);export{m as __pageData,g as default};
